import { privateAxios } from "./helper"
//create post function
export const createPost = (postData)=>{
    
    //console.log(postData.content+" This content iin Post DATA")
    return privateAxios.post(`/user/${postData.userId}/category/${postData.categoryId}/posts`).then(response=> response.postData)
}
///user/{userId}/category/{categoryId}/posts
